/* 2. List all the products posted by a particular seller, 10000. */

select item.itemid, item.attr5
from item
where item.accountid = '10000'

/* 3. List all the products in one of your categories (CD) bought by customer 10000. */

select item.itemid
from orders, product, item, category
where orders.userid = 10000
	and orders.itemid = item.itemid
	and item.productid = product.productid
	and product.category = category.catid
	and category.name = 'CD'

/* 4. List the most popular (most copies sold) of your products in the month of Sep 2012. */

SELECT * 
FROM 
(
SELECT i1.itemid id, SUM(o1.qty) qty
FROM item i1, orders o1, orderstatus os1
WHERE i1.itemid = o1.itemid
	AND o1.orderid = os1.orderid
	AND YEAR(os1.timestamp) = 2012
	AND MONTH(os1.timestamp) = 9
GROUP BY i1.itemid
) temp
WHERE temp.qty = (
	SELECT MAX(t2.qty)
	FROM (
		SELECT i2.itemid id, SUM(o2.qty) qty
		FROM item i2, orders o2, orderstatus os2
		WHERE i2.itemid = o2.itemid
			AND o2.orderid = os2.orderid
			AND YEAR(os2.timestamp) = 2012
			AND MONTH(os2.timestamp) = 9
		GROUP BY i2.itemid
	) t2
)

/* 5. Find the total amount of profit made from a customer, 10003 in the month of Jan 2012 in one of your categories. */

SELECT a.userid, sell.comin-buy.spend profit, sell.comin comin, buy.spend spend
FROM
account a,
(
SELECT a1.userid id,SUM(i1.listprice*o1.qty) comin
FROM account a1, item i1, orders o1, orderstatus os1
WHERE a1.userid = o1.sellerid
	AND o1.orderid = os1.orderid
	AND o1.itemid = i1.itemid
	AND YEAR(os1.timestamp) = 2012
	AND MONTH(os1.timestamp) = 1
GROUP BY a1.userid
) sell,
(
SELECT a2.userid id,
	
	SUM(i2.listprice*o2.qty) spend
FROM account a2, item i2, orders o2, orderstatus os2
WHERE a2.userid = o2.userid
	AND o2.orderid = os2.orderid
	AND o2.itemid = i2.itemid
	AND YEAR(os2.timestamp) = 2012
	AND MONTH(os2.timestamp) = 1
GROUP BY a2.userid
) buy

WHERE a.userid = sell.id AND a.userid = buy.id AND a.userid = 10003

